import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import { Link } from "react-router-dom";
import { Home } from "./components/Home";
import { Films } from "./components/Films";
import { People } from "./components/People";
import { Planets } from "./components/Planets";
import { Species } from "./components/Species";
import { Starships } from "./components/Starships";
import { Vehicles } from "./components/Vehicles";
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import {Navbar, Nav, NavDropdown, Form, FormControl, Button} from 'react-bootstrap';

export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isClacked: false
    };
  }

  componentDidMount() {
    this.mounted = true;
}

componentWillUnmount() {
  this.mounted = false;
}

  render() {
    return (
      <Router>
     <Navbar bg="light" expand="lg">
  <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link to="/" className="nav-link">
          Home
      </Nav.Link>
      <NavDropdown title="Dropdown" id="basic-nav-dropdown">
        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
      </NavDropdown>
    </Nav>
    <Form inline>
      <FormControl type="text" placeholder="Search" className="mr-sm-2" />
      <Button variant="outline-success">Search</Button>
    </Form>
  </Navbar.Collapse>
</Navbar>
        <div className="container fill">
          <ul className="nav">
            <li className="nav-item" >
              <Link to="/" className="nav-link">
                Home
              </Link>
            </li>
            <li className="nav-item" >
              <Link to="/films" className="nav-link">
                Films
              </Link>
            </li>
            <li className="nav-item" >
              <Link to="/people" className="nav-link">
                People
              </Link>
            </li>
            <li className="nav-item" >
              <Link to="/planets" className="nav-link">
                Planets
              </Link>
            </li>
            <li className="nav-item" >
              <Link to="/species" className="nav-link">
                Species
              </Link>
            </li>
            <li className="nav-item" >
              <Link to="/starships" className="nav-link">
                Starships
              </Link>
            </li>
            <li className="nav-item" >
              <Link to="/vehicles" className="nav-link">
                Vehicles
              </Link>
            </li>
          </ul>

          <Route path="/" component={Home} exact  key={1}/>

          <Route path="/films" component={Films} key={2}/>

          <Route path="/people" component={People} key={3}/>

          <Route path="/planets" component={Planets} key={4}/>

          <Route path="/species" component={Species} key={5}/>

          <Route path="/starships" component={Starships} key={6}/>

          <Route path="/vehicles" component={Vehicles} key={7}/>
        </div>
      </Router>
    );
  }
}
